        this._brands = brands
    }
    setDevices(devices){
        this._devices = devices
    }

    get selectedBrand(){
        return this._selectedBrand
    }

    get selectedType(){
        return this._selectedType
    }
    get devices(){
        return this._devices
    }
    get brands(){
        return this._brands
    }
    get types(){
        return this._types
    }
}
